import React from "react";
import "./Search.sass";
import { Input } from "antd";
const { Search } = Input;

const PhotoSearch = ({ setCurrentSearch }) => {
  // const onSearch = (e) => {
  //   setInput(e);
  //   console.log("222", e);
  //   search();
  // };

  return (
    <div className="search">
      <Search
        placeholder="input search text"
        allowClear
        onSearch={(e) => {
          setCurrentSearch(e);
        }}
        style={{
          width: 200,
        }}
      />
    </div>
  );
};

export default PhotoSearch;
